INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 0, 24001, 1, 40011, 125801, 2, "リリ", 321, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 0, 24001, 2, 40011, 126001, 2, "クリア", 322, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (1, "んーと。\nこれ、あげる。\nはい", 0, 24001, 3, 40011, 126101, 2, "プレシア", 323, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 0, 24001, 4, 40011, 125801, 2, "リリ", 324, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 0, 24001, 5, 40011, 126001, 2, "クリア", 325, 1);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (2, "お兄。\nきてくれて、うれしい", 0, 24001, 6, 40011, 126101, 2, "プレシア", 326, 1);
